	$('#default-star-rating').raty();

	// Default Score
	$('#score-rating').raty({
		score: 3
	});

	// Number of stars
	$('#no-of-stars').raty({
		number: 10
	});

	// Maximum number of stars
	$('#max-number-stars').raty({
		numberMax : 5,
		number    : 100
	});

	// Read Only
	$('#read-only-stars').raty({
		readOnly: true,
		score: 3
	});

    $('.read-only-star').raty({
        half     : true,
        readOnly: function() {
            return $(this).data('readonly');
        },
        score: function () {
            return $(this).attr('data-rating');
        }
    });

	// No Rated Message
	$('#no-rated-msg').raty({
		half: true
	});

	// Cancel Star
	$('#cancel-star').raty({
		cancel: true
	});

	// Space
	$('#space-star').raty({
		space: false
	});

	// Single
	$('#single-star').raty({
		single: true
	});

	// Half Star
	$('#half-star').raty({
		half     : true,
	});

	// Star Half
	$('#star-half').raty({
		half     : true,
		starHalf : 'star-half-mono.png'
	});

	// Round Enabled
