var placeSearch, autocomplete;
var componentForm = {
    street_number: 'short_name',
    route: 'long_name',
    administrative_area_level_1: 'short_name',
    country: 'long_name',
    postal_code: 'short_name',
    locality: 'long_name'
};

function initAutocomplete() {

    if($("#short_name").length){
      options = { componentRestrictions: {country: $('#short_name').val()} }
    } else {
      options = { componentRestrictions: {country: "se"} }
    }
    autocomplete = new google.maps.places.Autocomplete(
        /** @type {!HTMLInputElement} */(document.getElementById('autocomplete')),options);
    autocomplete.addListener('place_changed', fillInAddress);
}

function update_working_area() {
initAutocompleteWorkingAreaSearch();
if (navigator.geolocation) {
    navigator.geolocation.getCurrentPosition(function(position) {
        var geolocation = {
            lat: position.coords.latitude,
            lng: position.coords.longitude
        };
        var circle = new google.maps.Circle({
            center: geolocation,
            radius: position.coords.accuracy
        });
        autocomplete.setBounds(circle.getBounds());
    });
}
}

function initAutocompleteWorkingAreaSearch() {
options = {types: ['(cities)']};
autocomplete = new google.maps.places.Autocomplete(
    /** @type {!HTMLInputElement} */(document.getElementById('working_area_autocomplete')),options);
autocomplete.addListener('place_changed', fillInAddressWorkingArea);
}

function fillInAddressWorkingArea() {

    var place = autocomplete.getPlace();
    var lat = place.geometry.location.lat();
    var lng = place.geometry.location.lng();
    var placeId = place.place_id;
    console.log(lat);
    console.log(lng);
    document.getElementById("lat").value = lat;
    document.getElementById("long").value = lng;
    document.getElementById("postal_code__working_area").value = "";
    for (var i = 0; i < place.address_components.length; i++) {
        var addressType = place.address_components[i].types[0];
        if (componentForm[addressType]) {
            var val = place.address_components[i][componentForm[addressType]];
            var addre = addressType + '__working_area'
            $("#"+addre).val('');
            $("#"+addre).val(val);
            console.log($("#"+addre).val());
        }
    }
    if (place.address_components[2].length != 0 && place.address_components[2].types[0] == "postal_town") {
        $("#locality__working_area").val(place.address_components[2]["long_name"]);
    } else if ((place.address_components[3].length != 0 && place.address_components[3].types[0] == "postal_town")) {
        $("#locality__working_area").val(place.address_components[3]["long_name"]);
    }
}

function fillInAddress() {

    var place = autocomplete.getPlace();
    var lat = place.geometry.location.lat();
    var lng = place.geometry.location.lng();
    var placeId = place.place_id;

    console.log(lat);
    console.log(lng);

    document.getElementById("lat").value = lat;
    document.getElementById("long").value = lng;

    for (var component in componentForm) {
      document.getElementById(component).value = '';
      document.getElementById(component).disabled = true;
    }

    document.getElementById("street_number").disabled = false;

    for (var i = 0; i < place.address_components.length; i++) {
        var addressType = place.address_components[i].types[0];
        if (componentForm[addressType]) {
            var val = place.address_components[i][componentForm[addressType]];
            console.log(addressType)
            document.getElementById(addressType).value = val;
            var addre = addressType + '__1'
            $("#"+addre).val(val);
            console.log($("#"+addre).val());
        }
    }

    if (place.address_components[2].length != 0 && place.address_components[2].types[0] == "postal_town") {
        $("#locality").val(place.address_components[2]["long_name"]);
        $("#locality__1").val(place.address_components[2]["long_name"]);
    } else if ((place.address_components[3].length != 0 && place.address_components[3].types[0] == "postal_town")) {
      $("#locality").val(place.address_components[3]["long_name"]);
      $("#locality__1").val(place.address_components[3]["long_name"]);
    }

    console.log($("#postal_code__1").val().length);
    if ($("#postal_code__1").val().length == 0) {
        $("#postal_code__1").addClass('validate');
    }else {
        $("#postal_code__1").removeClass('validate');
        $('.error').css("display", "none");
    }
}

function geolocate() {
  initAutocomplete();
  if (navigator.geolocation) {
    navigator.geolocation.getCurrentPosition(function(position) {
      var geolocation = {
          lat: position.coords.latitude,
          lng: position.coords.longitude
      };
      var circle = new google.maps.Circle({
          center: geolocation,
          radius: position.coords.accuracy
      });
      autocomplete.setBounds(circle.getBounds());
    });
  }
}

